  state = {
    atletas: [],
  }

  async componentDidMount(){
    const response = await api.get('');
    console.log(response.data);
    this.setState({atletas: response.data});
  }


  render(){ 

    const {filmes} = this.state;

    return (
           <div>
             <h1>Atletas</h1>
             {atletas.map(atleta=>(<li key={atleta.nome}>
                <h2>{atleta.nome}</h2>
             </li>))}
           </div>
         );
  }
}

export default App;
